import React, { useState } from "react";
import { Auth } from 'aws-amplify';
import { NavLink, useNavigate } from 'react-router-dom';
import { Link, Redirect } from 'react-router-dom';
import { notification } from 'antd';


function Signup() {
    const [redirect, setRedirect] = useState(false);
    const [firstname, setFirstname] = useState('');
    const [lastname, setLastname] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const navigate = useNavigate();

    const handleFirstnameChange = (event) => {
        setFirstname(event.target.value);
    };

    const handleLastnameChange = (event) => {
        setLastname(event.target.value);
    };

    const handleEmailChange = (event) => {
        setEmail(event.target.value);
    };

    const handlePhoneChange = (event) => {
        setPhone(event.target.value);
    };

    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };

    const handleConfirmPasswordChange = (event) => {
        setConfirmPassword(event.target.value);
    };

    const handleSignup = (values) => {

        if (!err) {
            let { fname, lname, password, email, phoneNumber } = values;

            // show loader
            this.setState({ loading: true });

            Auth.signUp({
                username: email,
                password,
                attributes: {
                    email,
                    name: `${fname} ${lname}`,
                    phone_number: phoneNumber
                }
            })
                .then(() => {
                    notification.success({
                        message: 'Succesfully signed up user!',
                        description: 'Account created successfully, Redirecting you in a few!',
                        placement: 'topRight',
                        duration: 1.5,
                        onClose: () => {
                            this.setState({ redirect: true });
                        }
                    });

                    this.setState({ email });
                })
                .catch(err => {
                    notification.error({
                        message: 'Error',
                        description: 'Error signing up user',
                        placement: 'topRight',
                        duration: 1.5
                    });

                    this.setState({
                            loading: false
                    });
                });
            }
};

return (
    <div class="container">
        <h2>Sign Up</h2>

        <div>
            <label for="firstname">Firstname:</label>
            <input type="firstname" id="firstname" name="firstname" onChange={handleFirstnameChange} required />
        </div>

        <div>
            <label for="lastname">Lastname:</label>
            <input type="lastname" id="lastname" name="lastname" onChange={handleLastnameChange} required />
        </div>

        <div>
            <label for="email">Email:</label>
            <input type="email" id="email" name="email" onChange={handleEmailChange} required />
        </div>

        <div>
            <label for="phone">Phone Number:</label>
            <input type="tel" id="phone" name="phone" pattern="[0-9]{10}" placeholder="Enter a 10-digit phone number" onChange={handlePhoneChange} required />
        </div>


        <div>
            <label for="password">Password:</label>
            <input type="password" id="password" name="password" onChange={handlePasswordChange} required />
        </div>

        <div>
            <label for="confirm password">Confirm Password:</label>
            <input type="password" id="password" name="password" onChange={handleConfirmPasswordChange} required />
        </div>

        <div class="option">
            <input type="submit" value="Sign Up" onClick={() => handleSignup = (firstname, lastname, email, phonenumber, password, confirmPassword)} />
            <input type="submit" value="Cancel" onClick={() => navigate('/login')} />
        </div>
        {redirect && ( // Check if redirect is true
            <redirect
                to={{
                    pathname: '/verify-code',
                    search: `?email=${email}` // Assuming email is one of your state variables
                }}
            />
        )}
    </div>
);
}


export default Signup;
